import { BrowserRouter as Router, Link } from "react-router-dom";

function SearchTile({ data }) {
  const newTo = {
    pathname: "/nftPage/" + data.token_id,
  };

  return (
    <Link to={newTo}>
      <div className="border-2 ml-12 mt-5 mb-12 flex flex-col items-center rounded-lg w-32 md:w-48 shadow-2xl">
        <img
          src={data.image_preview_url}
          alt=""
          className="w-2 h-50 rounded-lg object-cover"
        />
        <div className="text-white w-full p-2 bg-gradient-to-t from-[#454545] to-transparent rounded-lg pt-3 -mt-10">
          <strong className="text-md">{data.name}</strong>
          <p className="display-inline text-sm">{data.description}</p>
        </div>
      </div>
    </Link>
  );
}

export default SearchTile;
